DROP TABLE IF EXISTS users;
DROP TABLE IF EXISTS photos;
DROP TABLE IF EXISTS tags;
DROP TABLE IF EXISTS users_tags;
DROP TABLE IF EXISTS posts;
DROP TABLE IF EXISTS history;
DROP TABLE IF EXISTS messages;

CREATE TABLE users
(
  id          INTEGER PRIMARY KEY AUTOINCREMENT,
  email       VARCHAR(255) NOT NULL UNIQUE,
  username    VARCHAR(255) NOT NULL,
  firstname   VARCHAR(255) NOT NULL,
  lastname    VARCHAR(255) NOT NULL,
  password    VARCHAR(255) NOT NULL,
  activation  TINYINT(1)          DEFAULT 0 NOT NULL,
  token       VARCHAR(255),
  gender      VARCHAR(6)   NOT NULL
    CHECK (gender IN ('male', 'female')),
  preference  VARCHAR(6)          DEFAULT 'both' NOT NULL
    CHECK (preference IN ('both', 'male', 'female')),
  personality VARCHAR(4)
    CHECK (personality IN ('ISTJ', 'ISFJ', 'INFJ', 'INTJ',
                           'ISTP', 'ISFP', 'INFP', 'INTP',
                           'ESTP', 'ESFP', 'ENFP', 'ENTP',
                           'ESTJ', 'ESFJ', 'ENFJ', 'ENTJ',
                           '')),
  occupancy   VARCHAR(255),
  bday        DATETIME     NOT NULL,
  rating      INTEGER             DEFAULT 0 NOT NULL,
  bio         TEXT,
  location    TEXT         NOT NULL,
  avatar      VARCHAR(255)        DEFAULT 'default.png',
  added       DATETIME            DEFAULT (datetime('now', 'localtime')),
  online      TINYINT(1)          DEFAULT 0 NOT NULL,
  last_seen   DATETIME            DEFAULT (datetime('now', 'localtime'))
);

CREATE TRIGGER last_seen
  UPDATE OF online
  ON users
BEGIN
  UPDATE users
  SET last_seen = (datetime('now', 'localtime'))
  WHERE id = OLD.id;
END;

CREATE TABLE photos
(
  id       INTEGER PRIMARY KEY AUTOINCREMENT,
  user_id  INTEGER,
  filename VARCHAR(255) NOT NULL UNIQUE,
  added    DATETIME            DEFAULT (datetime('now', 'localtime'))
);

CREATE TABLE tags
(
  id  INTEGER PRIMARY KEY AUTOINCREMENT,
  tag VARCHAR(255) NOT NULL UNIQUE
);

CREATE TABLE users_tags
(
  user_id INTEGER,
  tag_id  INTEGER,
  CONSTRAINT primary_id PRIMARY KEY (user_id, tag_id)
);

CREATE TABLE posts
(
  id      INTEGER PRIMARY KEY AUTOINCREMENT,
  user_id INTEGER,
  title   TEXT NOT NULL,
  post    TEXT NOT NULL,
  added   DATETIME            DEFAULT (datetime('now', 'localtime'))
);

CREATE TABLE messages
(
  id           INTEGER PRIMARY KEY AUTOINCREMENT,
  author_id    INTEGER,
  recipient_id INTEGER,
  message      TEXT NOT NULL,
  read         TINYINT(1)          DEFAULT 0 NOT NULL,
  added        DATETIME            DEFAULT (datetime('now', 'localtime'))
);

CREATE TABLE history
(
  id        INTEGER PRIMARY KEY AUTOINCREMENT,
  first_id  INTEGER,
  second_id INTEGER,
  `action`  VARCHAR(8) NOT NULL
    CHECK (`action` IN ('see', 'like', 'match', 'ban', 'break up', 'fake')),
  read      TINYINT(1)          DEFAULT 0 NOT NULL,
  added     DATETIME            DEFAULT (datetime('now', 'localtime'))
);

